function [X,U,s,exitcode] = solve_SOAR(X,U,s,J,ME,MI,T_max,w_max,...
                        s_max,s_min,w_v,soarParams,flag)                  
%                         c_size, Air_size, Ajc_size, Apr_size, b_size, ...
%                         Gir_size, Gjc_size, Gpr_size, h_size, q_size)
%SOLVE_SOAR     
%
% SOAR's main function that solves the problem fully.
%
% T. Reynolds -- RAIN Lab

%#codegen

N  = 10;        % number of time nodes
Nx = 10;        % number of states
Nu = 3;         % number of controls
iter_max = 15;  % maximum global iterations
exitcode = zeros(iter_max+2,1);

if (flag ==0)

    config = soarParams.config;

    % Get problem sizes
    c_size   = soarParams.c_size;
    b_size   = soarParams.b_size;
    h_size   = soarParams.h_size;
    q_size   = soarParams.q_size;
    Air_size = soarParams.Air_size;
    Ajc_size = soarParams.Ajc_size;
    Apr_size = soarParams.Apr_size;
    Gir_size = soarParams.Gir_size;
    Gjc_size = soarParams.Gjc_size;
    Gpr_size = soarParams.Gpr_size;
    l_dim    = soarParams.l_dim;
    soc_dim  = soarParams.soc_dim;
    n        = c_size;     % primal variables
    m        = h_size;     % number of inequality constraints
    p        = b_size;     % number of equality constraints
    l        = l_dim;      % dimension of linear cone
    ncones   = q_size;     % number of SOCs
    q        = soc_dim;    % dimension(s) of the SOCs
    % time     = zeros(iter_max,1);

    % Scaling matrices
    % Dx  = soarParams.Dx;
    % Du  = soarParams.Du;
    % Ds  = soarParams.Ds;
    % iDx = soarParams.iDx;

    % Initial and final conditions stored in initial guess X
    xi = X(1:Nx);
    xf = X(Nx*(N-1)+(1:7)); % LEAVE THIS AS 7

    for k = 1:iter_max

        % discretize
        [EH,BE,ES,AR] = foh(X,U,s,N,Nx,Nu,J);%,Dx,Du,Ds,iDx);

        % parse for ECOS
        [c,G,h,A,b] = parse_ecos(xi,xf,J,EH,BE,ES,AR,N,...
            ME,MI,T_max,w_max,s_max,s_min,...
            w_v,config);%,Dx,Du,Ds,iDx,config);

        % put A and G in compressed column storage
        [Air,Ajc,Apr] = convert_to_CCS(A,Air_size);
        [Gir,Gjc,Gpr] = convert_to_CCS(G,Gir_size);

        % call to ECOS
        y = run_ecos(n,m,p,l,ncones,c(1:c_size),...
            Gjc(1:Gjc_size),Gir(1:Gir_size),Gpr(1:Gpr_size),...
            h(1:h_size),reshape(q(1:q_size),q_size,1),...
            Ajc(1:Ajc_size),Air(1:Air_size),Apr(1:Apr_size),...
            b(1:b_size));

        % update solution
        diff        = norm(X - y(1:N*Nx),1); % difference in state vector
        X           = y(1:N*Nx); % soarParams.DX*y(1:N*Nx);
        U           = y(N*Nx+1:N*(Nx+Nu)); % soarParams.DU*y(N*Nx+1:N*(Nx+Nu));
        s           = y(N*(Nx+Nu)+2); % Ds*y(N*(Nx+Nu)+2);
        V           = y(N*(Nx+Nu)+3:N*(2*Nx+Nu)+1);
        exitcode(k) = y(c_size+1);
        %     time(k)     = y(c_size+2);
        % if one of the exitcodes indicates failue, the final
        % entry in exitcode is set to -1 to indicate this, and the
        % solution should not be used
        if (exitcode(k) ~= 0)
            exitcode(iter_max+2) = -1;
        end

        % check convergence. Note that we MUST take at least two iterations,
        % this is to avoid exiting early for very small maneuvers before things
        % have truly converged.
        if ( (k>1) && (norm(V,1) < 1e-5) && (diff < 1e-2) )
            % exit for loop since we've converged
            exitcode(iter_max+1) = k;
            break;
        end

    end

    % Sanity checks on the solution if we hit the max iterations
    if (k==iter_max) % hit max global iterations
        exitcode(iter_max+1) = iter_max;
        if (exitcode(iter_max+2) ~= -1 )
            if (norm(V,1) > 1e-5)
                exitcode(iter_max+2) = 3; % does not clash with ECOS exitcodes
            elseif (diff>5e-2)
                exitcode(iter_max+2) = 4;
            end
        end
    end
else
    exitcode(iter_max+2) = flag;
    X  = zeros(size(X));
    U = zeros(size(U));
    s  = s_max;
end
end

