function [ EH,BE,ES,AR ] = foh( X,U,s,N,Nx,Nu,J) %,Dx,Du,Ds,iDx )
%FOH   first order hold discretization
%
% FOH(X,U,s,N,Nx,Nu,J,Dx,Du,Dx) Computes the matrices (A,B,S,Z) 
% to numerically discretize a problem instance of SOAC about the trajectory 
% stored in X and U. Assumes a linear interpolation of the torque 
% between control nodes, of which there are N.
%
% These matrices give the first order Taylor series of the dynamics
% at the N time nodes dictated and correspond to a discrete time
% LTV system approximating the nonlinear dynamics.
%
% Inputs: 
%   - X (N*Nx by 1) current state at each discrete node
%   - U (N*Nu by 1) current control at each discrete node
%   - s (1 by 1) current final time
%   - N (1 by 1) number of discrete time nodes
%   - Nx (1 by 1) number of states
%   - Nu (1 by 1) number of controls
%   - J (3 by 3) spacecraft inertia matrix
%   - [omitted] Dx (Nx by Nx) scaling matrix for the state
%   - [omitted] Du (Nu by Nu) scaling matrix for the control
%   - [omitted] Ds (1 by 1) scaling matrix for the final time
%   - [omitted] iDx (Nx by Nx) inverse of Dx, precomputed
% Outputs: 
%   - EH (N*Nx by N*Nx)
%   - BE (N*Nu by N*Nu)
%   - ES (N*Nx by 1)
%   - ZE (N*Nx by 1)
%
% T. Reynolds -- RAIN Lab
%#codegen

len     = N-1;              % number of transition matrices
tau     = linspace(0,1,N);  % normalized time
Nsub    = 10;               % number of sub-interval points

% Set sizes for each discrete matrix
EH          = zeros(Nx*(len+1),Nx*(len+1));
EH(1:Nx,1:Nx) = eye(Nx);
BE          = zeros(Nx*(len+1),Nu*(len+1));
ES          = zeros(Nx*(len+1),1);
AR          = zeros(Nx*(len+1),1);

% Initial conditions
A0  = eye(Nx);
B0p = zeros(Nx*Nu,1);
B0m = zeros(Nx*Nu,1);
S0  = zeros(Nx,1);
R0  = zeros(Nx,1);

for k = 1:len

    % (re)define initial condition for integration
    xF = X(Nx*(k-1)+(1:Nx));
    P0 = [xF(:); A0(:); B0p(:); B0m(:); S0(:); R0(:)];

    um = U(Nu*(k-1)+(1:Nu));
    up = U(Nu*k+(1:Nu));
    u  = [reshape(um,Nu,1) reshape(up,Nu,1)];
    tspan = linspace(tau(k), tau(k+1), N);

    for k_ = 1:Nsub-1

        tk      = tspan(k_);
        tkp1    = tspan(k_+1);
        h       = tkp1-tk;

        k1 = deriv(tk    ,P0       ,u,tspan,s,J);
        k2 = deriv(tk+h/2,P0+h/2*k1,u,tspan,s,J);
        k3 = deriv(tk+h/2,P0+h/2*k2,u,tspan,s,J);
        k4 = deriv(tk+h  ,P0+h*k3  ,u,tspan,s,J);

        P0 = (P0+h/6*(k1+2*k2+2*k3+k4));
    end

    AF  = P0(Nx+1:Nx*(Nx+1));
    BFp = P0(Nx*(Nx+1)+1:Nx*(Nx+Nu+1));
    BFm = P0(Nx*(Nx+Nu+1)+1:Nx*(Nx+2*Nu+1));
    SF  = P0(Nx*(Nx+2*Nu+1)+1:Nx*(Nx+2*Nu+2));
    RF  = P0(Nx*(Nx+2*Nu+2)+1:Nx*(Nx+2*Nu+3));

    % Fill up matrices
    Ad  = reshape(AF,Nx,Nx);
    EH(Nx*k+(1:Nx),Nx*(k-1)+(1:Nx)) = Ad; % iDx*Ad*Dx;
    BE(Nx*k+(1:Nx),Nu*(k-1)+(1:Nu)) = Ad*reshape(BFm,Nx,Nu); % iDx*(Ad*reshape(BFm,Nx,Nu))*Du;
    BE(Nx*k+(1:Nx),Nu*k+(1:Nu))     = Ad*reshape(BFp,Nx,Nu); % iDx*(Ad*reshape(BFp,Nx,Nu))*Du;
    ES(Nx*k+(1:Nx))                 = Ad*reshape(SF,Nx,1); % iDx*(Ad*reshape(SF,Nx,1))*Ds;
    AR(Nx*k+(1:Nx))                 = Ad*reshape(RF,Nx,1); % iDx*Ad*reshape(RF,Nx,1);

end


end

function DX = deriv(t,X,u,tspan,s,J)
%#codegen
    Nx = 10;
    x   = X(1:Nx); 

    [f,A,Bp,Bm,Z] = get_f_vals(t,x,u,tspan,J);

    Phi = reshape(X(Nx+1:Nx*(Nx+1)),size(A));

    xdot        = s*f;
    Phi_dot     = (s*A)*Phi;
    Bdp_dot     = Phi\(s*Bp);
    Bdm_dot     = Phi\(s*Bm);
    Sd_dot      = Phi\f;
    Zd_dot      = Phi\(s*Z);

    DX      = [ xdot(:); Phi_dot(:); Bdp_dot(:);...
                Bdm_dot(:); Sd_dot(:); Zd_dot(:)];
end

function [f,A,Bp,Bm,Z] = get_f_vals(t,x,u,tspan,J)
%#codegen   
    tkm     = tspan(1);
    tkp     = tspan(end);     
    lam_km  = (tkp - t)/(tkp - tkm);
    lam_kp  = (t - tkm)/(tkp - tkm);

    % Interpolate u
    u_tau = lam_km .* u(:,1) + lam_kp .* u(:,2);

    % compute jacobian matrices
    [A,B,f] = Q_linearize(t,x,u_tau,J);

    Bp  = lam_kp*B;
    Bm  = lam_km*B;

    % compute z
    Z   = - A*x - B*u_tau;

end

function [ A,B,f ] = Q_linearize( t,x,u,J )
%Q_LINEARIZE    Linearize the attitude dynamics
%
% Q_linearize(t,x,u,P) returns the discrete representation of the
% quaternion-based attitude dynamics at the point (x,u) and time t.
%
% T. Reynolds -- RAIN Lab.
%#codegen

% States
q   = x(1:4)./norm(x(1:4));
q0  = q(1);
qv  = q(2:4);
hb  = x(5:7);
hw  = x(8:10);
w   = J\hb;

% Partials
dfq_dq      = 0.5 * [ 0 -w'; w -skew(w) ];
dfq_dhb     = 0.5 * [ -qv'; skew(qv)+q0*eye(3) ]/J;
dfq_dhw     = zeros(4,3);
dfhb_dq     = zeros(3,4);
dfhb_dhb    = skew(hb)/J - skew(w) + skew(hw)/J;
dfhb_dhw    = -skew(w);
dfhw_dq     = zeros(3,4);
dfhw_dhb    = zeros(3,3);
dfhw_dhw    = zeros(3,3);
dfq_du      = zeros(4,3);
dfhb_du     = -eye(3);
dfhw_du     = eye(3);

% Kinematics & Dynamics
fq  = 0.5 * [ -qv'; skew(qv)+q0*eye(3) ] * w;
fhb = -u + skew(hb+hw)*w;
fhw = u;

% Outputs
f = [ fq; fhb; fhw ];
A = [ dfq_dq dfq_dhb dfq_dhw;
      dfhb_dq dfhb_dhb dfhb_dhw;
      dfhw_dq dfhw_dhb dfhw_dhw ];
B = [ dfq_du; dfhb_du; dfhw_du ];

end

function [c,G,h,A,b] = parse_ecos(xi,xf,J,EH,BE,ES,AR,N,...
                                  ME,MI,T_max,w_max,s_max,s_min,...
                                  w_v,config)%,Dx,Du,Ds,iDx,config)
%#codegen
u_max = T_max .* ones(N*3,1);
w_max = w_max .* ones(N*3,1);
Nx = 10;
Nu = 3;
% Dq = Dx(1:4,1:4); % this is identity, so ignoring for now
% Dw = Dx(5:7,5:7);

% Hw  = [ kron(eye(N),[zeros(3,4) inv(J) zeros(3)]*Dx) ...
%         zeros(3*N,N*(Nu+2*Nx)+2) ];
Hw  = [ kron(eye(N),[zeros(3,4) inv(J) zeros(3)]) ...
        zeros(3*N,N*(Nu+2*Nx)+2) ];
% Hu  = [ zeros(N*3,N*Nx) kron(eye(N),eye(Nu)*Du) zeros(N*3,2*N*Nx+2) ];
Hu  = [ zeros(N*3,N*Nx) kron(eye(N),eye(Nu)) zeros(N*3,2*N*Nx+2) ];

Hu(1, N*Nx + 1) = sqrt(0.5);
Hu(2, N*Nx + 2) = sqrt(0.5);
Hu(3, N*Nx + 3) = sqrt(0.5);

Hu(N*Nu - 2, N*Nx + N*Nu - 2) = sqrt(0.5);
Hu(N*Nu - 1, N*Nx + N*Nu - 1) = sqrt(0.5);
Hu(N*Nu, N*Nx + N*Nu) = sqrt(0.5);

Hv  = [ zeros(N*Nx) zeros(N*Nx,N*3) ...
        zeros(N*Nx,2) eye(N*Nx) zeros(N*Nx,N*Nx) ];
Hg  = [ zeros(1,N*(Nx+3)) 1 0 zeros(1,2*N*Nx) ];
% Hs  = [ zeros(1,N*(Nx+3)) 0 Ds zeros(1,2*N*Nx) ];
Hs  = [ zeros(1,N*(Nx+3)) 0 1 zeros(1,2*N*Nx) ];
Hev = [ zeros(N*Nx,N*(2*Nx+3)+2) eye(N*Nx) ];

% Cost function
c = [ zeros(N*(Nx+Nu),1); 1; 0; zeros(N*Nx,1); w_v*ones(N*Nx,1) ];
% Equality constraints
% A = [ eye(Nx) repmat(zeros(Nx),1,N-1) zeros(Nx,N*(Nu+2*Nx)+2);
%     EH-eye(size(EH)) BE zeros(N*Nx,1) ES kron(eye(N),iDx) zeros(N*Nx,N*Nx);
%     repmat(zeros(7,Nx),1,N-1) horzcat(blkdiag(eye(4),Dw),zeros(7,3)) ...
%     zeros(7,N*(Nu+2*Nx)+2) ];
A = [ eye(Nx) repmat(zeros(Nx),1,N-1) zeros(Nx,N*(Nu+2*Nx)+2);
    EH-eye(size(EH)) BE zeros(N*Nx,1) ES eye(N*Nx) zeros(N*Nx,N*Nx);
    repmat(zeros(7,Nx),1,N-1) horzcat(eye(7),zeros(7,3)) ...
    zeros(7,N*(Nu+2*Nx)+2) ];
b = [xi; -AR; xf];
% Inequality constraints
Glin    = [ Hw; -Hw; Hu; -Hu; Hs; -Hs; Hv-Hev; -Hv-Hev ];
hlin    = [ w_max; w_max; u_max; u_max; ...
            s_max; -s_min; zeros(N*Nx,1); zeros(N*Nx,1) ];
% if (strcmp(config,'bie'))
%     Gquad = zeros(152,332);
%     hquad = zeros(152,1);
% elseif (strcmp(config,'bi'))
%     Gquad = zeros(92,332);
%     hquad = zeros(92,1);
% else
%     Gquad = zeros(32,332);
%     hquad = zeros(32,1);
% end
Gquad   = [ -Hg./sqrt(2); -Hu; Hg./sqrt(2) ];
hquad   = [ 1/sqrt(2); zeros(size(Hu,1),1); 1/sqrt(2) ];
if (strncmp(config,'bi',2))
    Hq  = [ eye(4) zeros(4,6) ];
    Gquad_ = [Gquad; zeros(60,332)];
    hquad_ = [hquad; zeros(60,1)];
    for k = 1:N
        Hk = zeros(Nx,332);
        Hk(1:Nx,Nx*(k-1)+(1:Nx)) = eye(Nx);
%         Pk = MI*Hq*Dx*Hk;
        Pk = MI*Hq*Hk;
        Gk = [ zeros(1,332); -Pk; zeros(1,332) ];
        hk = [ 3/sqrt(2); zeros(size(Pk,1),1); -1/sqrt(2) ];
        Gquad_(6*(k-1)+(33:38),:) = Gk;
        hquad_(6*(k-1)+(33:38)) = hk;
    end
    if (strcmp(config,'bie'))
        Gquad__ = [Gquad_; zeros(60,332)];
        hquad__ = [hquad_; zeros(60,1)];
        for k = 1:N
            Hk = zeros(Nx,332);
            Hk(1:Nx,Nx*(k-1)+(1:Nx)) = eye(Nx);
%             Pk = ME*Hq*Dx*Hk;
            Pk = ME*Hq*Hk;
            Gk = [ zeros(1,332); -Pk; zeros(1,332) ];
            hk = [ 3/sqrt(2); zeros(size(Pk,1),1); -1/sqrt(2) ];
            Gquad__(6*(k-1)+(33:38),:) = Gk;
            hquad__(6*(k-1)+(33:38)) = hk;
        end
        G = [Glin;Gquad__];
        h = [hlin;hquad__];
    else
        G = [Glin;Gquad_];
        h = [hlin;hquad_];
    end
else
    G = [Glin;Gquad];
    h = [hlin;hquad];
end    

end % parse_ecos

function [Xir,Xjc,Xpr] = convert_to_CCS(X,Xir_size)
%#codegen
    [Xir,Xpr] = my_find(X,Xir_size);
    Xjc = zeros(size(X,2)+1,1,'int32');
    for col = 2:size(X,2)
        Xjc(col) = Xjc(col-1)+int32(nnz(X(:,col-1)));
    end
    Xjc(end) = int32(nnz(X));
end

function [Xir,Xpr] = my_find(X,Xir_size)
%#codegen
% [n,m] = size(X);
n = int32(size(X,1));
m = int32(size(X,2));
Xir   = zeros(Xir_size,1,'int32');
Xpr   = zeros(Xir_size,1);
X_nnz = nnz(X);
id = 1;
for col = 1:m
    for row = 1:n
        if ((X(row,col)~=0) && (id<X_nnz+1))
            Xir(id) = row-1; % zero based row indexing
            Xpr(id) = X(row,col);
            id = id + 1;
        end
    end
end
end

