function [X0,U0,s0,J,ME,MI,T_max,w_max,s_max,s_min,w_v, flag] = init_SOAR(q0,w0,hw0,qf,wf,sI,soarParams)
%INIT_SOAR    
%
% SOAR's init function. Initializes all parameters are provides the initial
% guess to SOAR's main solve function. 
%
% T. Reynolds -- RAIN Lab

%#codegen

% constraints
cB      = [ 0.0; 0.0; -1.0 ];   % camera boresight vector
ssB     = [ 0.0; 1.0; 0.0 ];    % sun sensor boresight vector
amin    = deg2rad(50);          % min. separating angle
amax    = deg2rad(60);          % FOV of sun sensor
Me      = [ sI'*cB             (skew(sI)*cB)';
            skew(sI)*cB  sI*cB'+cB*sI'-(sI'*cB)*eye(3) ] - cos(amin)*eye(4);
Mi      = [ sI'*ssB             (skew(sI)*ssB)';
            skew(sI)*ssB  sI*ssB'+ssB*sI'-(sI'*ssB)*eye(3) ] - cos(amax)*eye(4);
Met     = Me + 2*eye(4);    % M_exclude_tilde
Mit     = 2*eye(4) - Mi;    % M_include_tilde
% compute matrix square root. Cannot use MX = sqrtm(Mxt) since complex
% values may be returned, and these must be turned off for code generation
[Ve,De] = schur(Met);
[Vi,Di] = schur(Mit);
for k = 1:4
    De(k,k) = realsqrt(De(k,k));
    Di(k,k) = realsqrt(Di(k,k));
end
ME  = Ve*De*Ve';    % exclusion constraint matrix
MI  = Vi*Di*Vi';    % inclusion constraint matrix
s_min   = soarParams.s_min;       % min allowable time
s_max   = soarParams.s_max;       % max allowable time

% controller parameters
N       = 10;   % number of time nodes
Nx      = 10;   % number of states
Nu      = 3;    % number of controls

% spacecraft inertia matrix & constraint values (set in init_soac_params)
J       = soarParams.inertia;  % kg m2
T_max   = soarParams.T_max;    % mNm
w_max   = soarParams.w_max;    % rad/s
w_v     = soarParams.w_v;      % virtual control weight

% Initial trajectory
x0  = zeros(Nx,N);
u0  = zeros(Nu,N);
s0  = s_max; 
tau = linspace(0,1,N);
[qb,flag] = Q_SLERP(q0,qf);
if ( flag == 0 )
    for k = 1:N
        wk = zeros(3,1);
        for i = 1:3
           wk(i) = interp1([0 1],[w0(i) wf(i)],tau(k),'linear');
        end
        x0(:,k)   = [ qb(:,k); J*wk; hw0 ];
        u0(:,k)     = zeros(3,1);
    end
end

% Initial state and control guess
X0   = reshape(x0,Nx*N,1);
U0   = reshape(u0,Nu*N,1);

end

function [qt,FLAG] = Q_SLERP( q0,q1 )
%Q_SLERP 
%
% Q_SLERP(q0,q1,tspan) Uses Spherical Linear intERPolation to 
% interpolate between two quaternions given the time space tspan. 
% Both q0 and q1 must be quaternions.
%
% T.Reynolds -- RAIN Lab.
%#codegen

N    = 10;
FLAG = int8(0);

if ( length(q0)~=4 || length(q1)~=4 )
   FLAG = int8(1);
   qt   = repmat([1.0;0.0;0.0;0.0],1,N);
   return;
end

% Reshape inputs to be column vectors
q0  = reshape(q0, 4, 1);
q1  = reshape(q1, 4 ,1);

% Find angle between inputs -- careful to avoid degenerate numerical cases
% that lead to acos being imaginary.
temp = dot(q0,q1);
if (1.0-temp<0)
    ang = 0.0;
else
    ang = acos(temp);
end
if ( ang > pi )
    FLAG = int8(2);
    qt   = repmat([1.0;0.0;0.0;0.0],1,N);
    return;
end

sang = sin(ang);
% if sang is zero, then q0 and q1 are the same, and this will output q0 
if (sang<1e-8)
    qt = repmat(q0,1,N);
else
    qt   = zeros(4,N);
    for k = 1:N
        t       = (k-1)/(N-1);
        qt(:,k) = (sin((1 - t)*ang)/sang).*q0 + (sin(t*ang)/sang).*q1;
    end
end
end
